package icehs.science.chapter03;

public class DataTypeHelpEx {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		/*
		 * int one = 1000L;
		 * long two = 10000000000;
		 * double three = 10;
		 * int four = three;
		 */
		
		int one = (int)1000L;
		long two = 10000000000L;
		double three = 10;
		int four = (int)three;
	}

}
